import React, { Component } from "react";
import { Modal, Button } from "react-bootstrap";

class Formularioss extends Component {
state = {
isOpen: false

};

openModal = () => this.setState({isOpen: true});
CloseModal = () => this.setState({isOpen: false});

render(){
return (
<>
<div 
className="d-flex align-items-center justify-content-center"
style={{height: "80vh"}}
>
    <Button varint="primary" onClick={this.openModal}>

    </Button>


</div>
<Modal show={this.state.isOpen} onHide={this.CloseModal}>
    <Modal.Header closeButton>
        <Modal.Title>Modal de prueba</Modal.Title>
    </Modal.Header>
    <Modal.Body>Esta es la manera de crear un modal</Modal.Body>
    <Modal.Footer>
        <Button variant="secondary" onClick={this.CloseModal}></Button>
    </Modal.Footer>
</Modal>
</>
);


}






}
